import React from 'react';
import Beer from './beer';
import Hea from '../../images/home/beersandbrewskiesstudio.jpg';

const HeaderSection = () => {
  return(
      <div className="row shadow header-section">
      <div className="col-md-5 p-lg-5 my-5">
    <h1 className="display-4 font-weight-normal">Beers and Brewskies</h1>
    <p className="lead font-weight-normal">"Great stories are told over beer"</p>
  </div>
      </div>
  )
}

export default HeaderSection;
